The following is a system Verilog module for an LDPC encoder designed for FPGA implementation:

```
module ldpc_encoder(
    input [31:0] data,
    input [31:0] syndrome,
    output [0:95] encoded,
    input clk,
    input rst
);

reg [0:95] encoded_reg;
wire [0:95] encoded_wire;

always #5 encoded_reg <= encoded_wire;

always @(posedge clk or posedge rst)
    begin
        if (rst)
            begin
                encoded_reg <= 0;
                encoded_wire <= 0;
            end
        else
            begin
                encoded_wire <= syndrome ^ data;
            end
    end

assign encoded = encoded_reg;

endmodule
```

This module takes in a data input, a syndrome input, and outputs an encoded signal. The encoded signal is generated by XORing the data input with the syndrome input. The module is clocked and resets on the rising edge of the clock signal. The encoded signal is stored in a register and outputted.
